import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const ListCheck = () => {
  const products = [
    {
      id: 1168761308,
      quantity: 2,
      name: 'Vintage Clock',
      category: 'Tech',
      price: 18.34,
    },
    {
      id: 589605485,
      quantity: 1,
      name: 'Reusable Cup',
      category: 'Cups',
      price: 35.39,
    },
  ];

  return (
    <div className="container py-5">
      <div className="row">
        <div className="col">
          <table className="table table-striped table-bordered">
            <thead>
              <tr>
                <th>Table</th>
                <th>Items</th>
                <th>Quantity</th>
                <th>Price</th>
                <th>Total</th>
              </tr>
            </thead>
            <tbody>
              {products.map((product, index) => (
                <tr key={product.id}>
                  {/* Table Number (Index) */}
                  <td>{index + 1}</td>
                  {/* Items */}
                  <td>
                    <div>
                      <strong>{product.name}</strong>
                      <div className="text-muted">{product.category}</div>
                    </div>
                  </td>
                  {/* Quantity */}
                  <td>
                    <div className="d-flex align-items-center">
                      <button className="btn btn-outline-secondary btn-sm mx-1">-</button>
                      <input
                        type="text"
                        className="form-control text-center"
                        value={product.quantity}
                        style={{ width: '60px' }}
                        readOnly
                      />
                      <button className="btn btn-outline-secondary btn-sm mx-1">+</button>
                    </div>
                  </td>
                  {/* Price */}
                  <td>${product.price.toFixed(2)}</td>
                  {/* Total */}
                  <td>${(product.price * product.quantity).toFixed(2)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ListCheck;
